import { Routes, Route } from "react-router-dom";
import Home from "./components/home/Home"
function App() {
  return (
    <>
      <Routes>

        <Route path="/">

          <Route index element={<Home/>} />

          <Route path="about" element={<Home />} />

        </Route>

      </Routes>
      {/* <Navbar />
      <Hero />
      <Best />
      <Featured />
      <Footer /> */}
    </>
  );
}

export default App;
